".datepicker-modal {
    position: fixed;
    right: 0;
    bottom: 0;
    width: 100%;
    height: 100%;
    background-color: rgba(0, 0, 0, .6);
    z-index: 999;
    display: -webkit-box;
    display: -ms-flexbox;
    display: flex;
    -webkit-box-align: center;
        -ms-flex-align: center;
            align-items: center;
    -webkit-box-pack: center;
        -ms-flex-pack: center;
            justify-content: center;
}

.datepicker {
    position: absolute;
    left: 0;
    bottom: 0;
    width: 100%;
    z-index: 1;
    font-size: 16px;
    text-align: center;
    font-family: arial,verdana,sans-serif;
    -webkit-box-sizing: content-box;
            box-sizing: content-box;
    -webkit-font-smoothing: antialiased;
    -webkit-user-select: none;
       -moz-user-select: none;
        -ms-user-select: none;
            user-select: none;
}

.datepicker .datepicker-header {
        padding: 0 .5em;
        min-height: 2em;
        line-height: 2em;
        font-size: 1.125em;
    }

.datepicker .datepicker-navbar {
        padding: 0 .5em .5em .5em;
        overflow: hidden;
    }

.datepicker .datepicker-navbar-btn {
        height: 2.5em;
        line-height: 2.5em;
        float: right;
        padding: 0 1em;
        cursor: pointer;
    }

.datepicker .datepicker-content {
        display: -webkit-box;
        display: -ms-flexbox;
        display: flex;
        padding: .5em .25em;
    }

.datepicker .datepicker-col-1 {
        -webkit-box-flex: 1;
            -ms-flex: 1;
                flex: 1;
        margin: 0 .25em;
    }

.datepicker .datepicker-viewport {
        height: 200px;
        position: relative;
        overflow: hidden
    }

.datepicker .datepicker-viewport::after {
    content: '';
    position: absolute;
    z-index: 2;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    pointer-events: none;
}

.datepicker .datepicker-wheel {
        position: absolute;
        height: 40px;
        top: 50%;
        margin-top: -20px;
        width: 100%;
    }

.datepicker .datepicker-scroll {
        list-style-type: none;
        padding: 0
    }

.datepicker .datepicker-scroll>li {
    height: 40px;
    line-height: 40px;
    font-size: 1.375em;
    cursor: pointer;
}

.datepicker {

